import React, { useState } from 'react';
import Card from '../common/Card';
import Button from '../common/Button';
import { useAppContext } from '../../contexts/AppContext';

const ExploreScreen = () => {
  const { exploreFeed } = useAppContext();
  const [activeCategory, setActiveCategory] = useState('all');

  const categories = [
    { id: 'all', label: 'All' },
    { id: 'events', label: 'Events' },
    { id: 'artists', label: 'Artists' },
    { id: 'venues', label: 'Venues' },
    { id: 'opportunities', label: 'Opportunities' }
  ];

  const filteredFeed = activeCategory === 'all' 
    ? exploreFeed 
    : exploreFeed.filter(item => item.category === activeCategory);

  return (
    <div className="screen explore-screen">
      <div className="explore-header">
        <h2>Discover</h2>
        <div className="category-tabs">
          {categories.map(cat => (
            <button
              key={cat.id}
              className={`category-tab ${activeCategory === cat.id ? 'active' : ''}`}
              onClick={() => setActiveCategory(cat.id)}
            >
              {cat.label}
            </button>
          ))}
        </div>
      </div>

      <div className="explore-feed">
        {filteredFeed.map(item => (
          <Card key={item.id} className="feed-card">
            {item.image && (
              <div className="feed-card-image">
                <img src={item.image} alt={item.title} />
              </div>
            )}
            <div className="feed-card-content">
              <div className="feed-card-header">
                <span className="feed-category-badge">{item.category}</span>
                {item.isPromoted && <span className="promoted-badge">Promoted</span>}
              </div>
              <h3>{item.title}</h3>
              <p className="feed-card-description">{item.description}</p>

              {item.type === 'event' && (
                <div className="event-details">
                  <span>📅 {item.date}</span>
                  <span>📍 {item.location}</span>
                  <span>🎟️ {item.price}</span>
                </div>
              )}

              {item.type === 'artist' && (
                <div className="artist-details">
                  <div className="genre-tags">
                    {item.genres?.map(genre => (
                      <span key={genre} className="genre-tag">{genre}</span>
                    ))}
                  </div>
                  <div className="artist-stats">
                    <span>{item.followers} followers</span>
                    <span>{item.bookings} bookings</span>
                  </div>
                </div>
              )}

              {item.type === 'opportunity' && (
                <div className="opportunity-details">
                  <p className="opportunity-type">{item.opportunityType}</p>
                  <p className="opportunity-budget">{item.budget}</p>
                  <p className="opportunity-deadline">Apply by {item.deadline}</p>
                </div>
              )}

              <div className="feed-card-actions">
                <Button variant="text" size="small">
                  {item.type === 'event' ? 'Get Tickets' : 
                   item.type === 'opportunity' ? 'Apply Now' :
                   'View More'}
                </Button>
                <div className="feed-card-engagement">
                  <button className="engagement-btn">❤️ {item.likes}</button>
                  <button className="engagement-btn">💬 {item.comments}</button>
                  <button className="engagement-btn">↗️</button>
                </div>
              </div>
            </div>
          </Card>
        ))}
      </div>
    </div>
  );
};

export default ExploreScreen;
